import React, {Component} from 'react';
import { Query }                from 'react-apollo'
import gql                      from 'graphql-tag'
import Link                     from 'next/link'
import { Container, Row, Col, Carousel }  from 'react-bootstrap'

import './SliderMainPage.less';

export const mpslider = gql`
query mpslides{
  mpslides{
    id
    name
    image
    firstHeader
    secondHeader
    button
    url
  }
}
`

class SliderMainPage extends Component{
  render () {
    return (
      <div className="container-fluid sliderHomePageComponent">
        <Carousel>
          <Carousel.Item>
            <div className="slide_1 slides"></div>
            <Carousel.Caption>
              <h3>First slide label</h3>
              <p>Nulla vitae elit libero, a pharetra augue mollis interdum.</p>
            </Carousel.Caption>
          </Carousel.Item>
        </Carousel>
      </div>
    )
  }
}
export default SliderMainPage;
